  title: 'Components/Molecules/Button',
  component: ButtonComponent,
  //👇 Import both components to allow component compositing with Storybook
  decorators: [
    moduleMetadata({
      declarations: [ButtonComponent, TitleComponent],
      imports: [CommonModule],
    }),
    //👇 Wrap our stories with a decorator (optional)
    // componentWrapperDecorator(story => `<div style="margin: 3em">${story}</div>`),
  ],
  argTypes: {
    css: {
      options: ['button-primary', 'button-secondary', 'button-tertiary'],
      control: { type: 'select' },
    },
    disabled: {
      options: [true, false],
      control: { type: 'radio' },
    },
    type: {
      options: ['button', 'reset', 'submit'],
      control: { type: 'radio' },
    },
  },
  render: (args: StoryComponent) => {
    const { title, ...buttonProps } = args;
    const { text, ...titleProps } = title;

    return {
      props: { buttonProps, titleProps },
      template: `
      <c-button [css]="buttonProps.css" [disabled]="buttonProps.disabled" [type]="buttonProps.type">
      <c-title [css]="titleProps.css" [color]="titleProps.color">${text}</c-title>
    </c-button>
      `,
    };
  },
}

{
  title: 'Components/Molecules/Input',
  component: InputComponent,
  //👇 Import both components to allow component compositing with Storybook
  decorators: [
    moduleMetadata({
      declarations: [InputComponent, LabelComponent, ErrorInputComponent],
      imports: [CommonModule, FormsModule, ReactiveFormsModule],
    }),
    //👇 Wrap our stories with a decorator (optional)
    // componentWrapperDecorator(story => `<div style="margin: 3em">${story}</div>`),
  ],
  argTypes: {
    css: {
      options: ['input-primary', 'input-secondary', 'input-tertiary'],
      control: { type: 'select' },
    },
    disabled: {
      options: [true, false],
      control: { type: 'radio' },
    },
    type: {
      options: ['number', 'text', 'email', 'password'],
      control: { type: 'radio' },
    },
  },
  render: (args: StoryComponent) => {
    const { label, ...inputProps } = args;
    const { text, ...inputLabel } = label;

    const sharedFormControl = new FormControl('', Validators.required);

    return {
      props: { inputProps, inputLabel, sharedFormControl },
      template: `
      <c-label [css]="inputLabel.css">
        ${text}
        <c-input
        [css]="inputProps.css"
        [type]="inputProps.type"
        [placeholder]="inputProps.placeholder"
        [formControl]="sharedFormControl"
        [disabled]="inputProps.disabled"
        [name]="inputProps.name"></c-input>
      </c-label>

      `,
    };
  },
}

{
  args: {
    css: 'button-primary',
    title: {
      css: 'title-base',
      color: 't-white',
      text: 'Text button',
    },
  },
}

{
  args: {
    css: 'input-primary',
    type: 'text',
    placeholder: 'Entry text',
    disabled: false,
    name: 'example',
    label: {
      css: 'label-primary',
      text: 'Label text',
    },
  },
}

